DROP TABLE IF EXISTS `register`;
CREATE TABLE `register` (
  `student` int NOT NULL,
  `event` int NOT NULL,
  PRIMARY KEY (`student`,`event`),
  KEY `student` (`student`),
  KEY `event` (`event`),
  CONSTRAINT `register_ibfk_1` FOREIGN KEY (`student`) REFERENCES `students` (`id`),
  CONSTRAINT `register_ibfk_2` FOREIGN KEY (`event`) REFERENCES `events` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

